import React from 'react';

const [DashboardMethod, setDashboardMethod] = useState('');

const handleDashboardMethod = (method) => {
    setDashboardMethod(method);
};
const Dashboard = () => {
    return (
        <div>
            <h1>Bienvenido a la nueva página</h1>
            <p>Has iniciado sesión con éxito.</p>
            <input type="submit" value="Modo edición" onClick={() => handleDashboardMethod('tarjeta de crédito')}/>
            
        </div>
    );
};

export default Dashboard;
